INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 0, "人助け、応援", 2, 44, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "ヒヨリ", "獣人族", 100101, 155, "トゥインクルウィッシュ", "東山奈央", 27, 8, "人助けが大好き！　前向き格闘娘", 16);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 0, "料理、人間観察", 2, 47, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ユイ", "ヒューマン", 100201, 158, "トゥインクルウィッシュ", "種田梨沙", 5, 4, "戦闘のサポートが得意な、心優しい少女", 17);
