INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 0, "いたずら、探検", 5, 27, "イタズラなら任せて！\nにいちゃん、引っかからないように気を付けなよー♪", "ミソギ", "ヒューマン", 100401, 128, "リトルリリカル", "諸星すみれ", 10, 8, "探検好きのイタズラっ子", 9);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 0, "ヒーローごっこ", 8, 40, "？？？", "マツリ", "獣人族", 100501, 146, "王宮騎士団（NIGHTMARE）", "下田麻美", 25, 11, "ヒーローに憧れる騎士見習いの少女", 12);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 0, "サックス", 7, 42, "アカリ、まだわからないことが多くて…\nだからこれから\nいろいろ教えてくださいね、お兄ちゃん！", "アカリ", "魔族", 100601, 150, "悪魔偽王国軍（ディアボロス）", "浅倉杏美", 22, 11, "甘え上手なみんなの人気者", 13);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 0, "プリンを食べること", 7, 32, "難しいことはわからないの～\nただ毎日プリンを食べられるなら、\n幽霊のままでいいの～", "ミヤコ", "魔族", 100701, 130, "悪魔偽王国軍（ディアボロス）", "雨宮天", 23, 1, "プリン大好きゴースト娘", 14);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("AB", 0, "鏡で自分を見ること", 15, 40, "ボクって本当に美しいなあ…\n可愛くて美しいなんて本当に罪だと思うけど\n生まれもったものだから仕方ないんだ♪", "ユキ", "エルフ", 100801, 150, "ヴァイスフリューゲル　ランドソル支部", "大空直美", 10, 10, "ボクは誰よりも美しい", 14);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 0, "小説執筆", 13, 45, "いいか、絶対に私を真名で呼ぶなよ？\n常に「機関」の眼や耳の存在を疑え\nそれが、生きのびるための術だ…！", "アンナ", "魔族", 100901, 159, "トワイライトキャラバン", "髙野麻美", 5, 7, "前世を信じる中二病患者、「疾風の冥姫」", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 0, "空想、ぬいぐるみ集め", 10, 42, "マホマホ王国のお姫はんの、マホ姫どす！\nけったいな顔してどないしはったん？\nマホマホ王国はずーっと遠くの国なんどす？", "マホ", "獣人族", 101001, 155, "自警団（カォン）", "内田真礼", 22, 9, "マホマホ王国のプリンセス", 16);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 0, "お裁縫", 3, 44, "覚えていないと思うんですけど…\n私は妹なんですよ！\nだからお兄ちゃんって呼んでいいですか？", "リノ", "ヒューマン", 101101, 156, "ラビリンス", "阿澄佳奈", 25, 8, "人懐っこくてマシンガントークな妹系少女", 15);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 0, "妹と遊ぶこと、二度寝、昼寝、早寝", 6, 46, "私はハツネ！　困っている人の味方だよ！\n困った時は、いつでも言ってね♪\n私のちょ…ま、魔法で助けてあげるから！", "ハツネ", "エルフ", 101201, 156, "フォレスティエ", "大橋彩香", 24, 12, "みんなのために超能力を使う眠り姫", 17);
