INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 0, "ファッション", 14, 48, "ヒデサイ、ちょっす～！　うち、漢字と計算は\nちょっち…てか、おに苦手なんだ～\nでもでも、ファッションだったら任せて～！", "スズナ", "魔族", 101601, 167, "ルーセント学院", "上坂すみれ", 10, 4, "天真爛漫で人気者のカリスマモデル", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 0, "踊り、空手", 10, 53, "ハイターイ！　歌って踊って、\n最高に盛り上がるさ～！\nやさやさ、キミも一緒に踊るさ～！", "カオリ", "獣人族", 101701, 158, "自警団（カォン）", "高森奈津美", 7, 7, "いつでも「なんくるないさ～」な天然娘", 19);
