INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 0, "かわいいもの集め", 5, 21, "ぴょんぴょん、うさぎさんになりたいな～♪　\nミミ、うさぎさんになれたら、\n最初におにいちゃんに見せてあげるね！", "ミミ", "獣人族", 102001, 117, "リトルリリカル", "日高里菜", 3, 4, "お歌もにんじんも、ウサギさんも大好き♪", 10);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 0, "観劇、おままごと", 9, 40, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "クルミ", "ヒューマン", 102101, 150, "サレンディア救護院", "植田佳奈", 9, 6, "泣き虫で臆病な守ってあげたい女の子", 12);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 0, "ゲーム全般", 7, 40, "え、えっと…こ、こういうときって、\nどういうことを言えばいいんだっけ…\nうう、どうしてちゃんと喋れないの…", "ヨリ", "魔族", 102201, 150, "悪魔偽王国軍（ディアボロス）", "原紗友里", 22, 11, "人見知りであまのじゃくな女の子", 13);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 0, "屋内でできる遊び", 9, 38, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "アヤネ", "ヒューマン", 102301, 148, "サレンディア救護院", "芹澤優", 10, 5, "ぷうきちといつも一緒！", 14);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 0, "ご奉仕", 9, 43, "うぅ…ごめんなさい～…\nまたキッチンを爆発させてしまいました～\nこれじゃあメイド失格です…", "スズメ", "ヒューマン", 102501, 154, "サレンディア救護院", "悠木碧", 12, 12, "お嬢さまのためにがんばるドジっ娘メイド", 15);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 0, "あんパン", 11, 42, "test", "リン", "獣人族", 102601, 144, "牧場（エリザベスパーク）", "小岩井ことり", 1, 1, "遊びと睡眠が何より大事なぐうたら娘", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 0, "実験、裁縫、料理", 13, 43, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "エリコ", "魔族", 102701, 154, "トワイライトキャラバン", "橋本ちなみ", 30, 7, "運命の相手に一途すぎる乙女", 16);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 0, "経営、お茶会", 9, 43, "貧乏性？　いいえ、\n「もったいない」の精神で\n日々を過ごしてるだけよ！", "サレン", "エルフ", 102801, 156, "サレンディア救護院", "堀江由衣", 4, 10, "救護院を経営する優しい庶民派お嬢様", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 0, "舞台鑑賞、ダンス", 4, 40, "いつか世界中の人達をファンにしてみせる！\nトップアイドルになるその日まで、\n応援よろしくね♪", "ノゾミ", "ヒューマン", 102901, 157, "カルミナ", "日笠陽子", 24, 1, "歌って踊れる大人気アイドル", 17);
