INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("AB", 0, "占い", 7, 42, "私、小さい頃から人には見えないものが\n見えていたんです。今もあなたの後ろに\n一人、二人、三人…賑やかですね", "シノブ", "魔族", 103101, 157, "悪魔偽王国軍（ディアボロス）", "大坪由佳", 22, 12, "占いが得意な霊能少女", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("AB", 0, "慈善事業", 12, 45, "この私とともにいる限り、\nお金に不自由はさせませんわ！", "アキノ", "ヒューマン", 103201, 157, "メルクリウス財団", "松嵜麗", 12, 3, "一人前の商人を目指すパワフルお嬢様", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 0, "漫才", 11, 35, "オラはどんな時でもみんなに笑顔を届ける\n最高の芸人目指してる！\n一緒に頑張るべ！", "マヒル", "ヒューマン", 103301, 142, "牧場（エリザベスパーク）", "新田恵海", 3, 3, "みんなを笑顔にするお笑い牧場主", 20);
