INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 0, "読書、お散歩", 11, 40, "ゴホッ、ゴホッ…か、身体は弱いけど、\nせめて気持ちだけでも前向きに…！\nあっ、でもダメ…立ちくらみが…", "シオリ", "獣人族", 103801, 153, "牧場（エリザベスパーク）", "小清水亜美", 3, 11, "読書が趣味の病弱少女", 14);
