INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 0, "お菓子作り", 10, 54, "腹へってたら言えよな\n簡単でよければ\nすっげー旨いもん食わせてやるよ！", "マコト", "獣人族", 104301, 168, "自警団（カォン）", "小松未可子", 9, 8, "男勝りで情に厚いワイルド娘", 17);
