INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 0, "各種楽器", 4, 46, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "チカ（クリスマス）", "ヒューマン", 108401, 163, "カルミナ", "福原綾香", 3, 6, "人々を守るために歌う、唱喚士の少女", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 0, "観劇、おままごと", 9, 40, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "クルミ（クリスマス）", "ヒューマン", 108501, 150, "サレンディア救護院", "植田佳奈", 9, 6, "泣き虫で臆病な守ってあげたい女の子", 12);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 0, "屋内でできる遊び", 9, 38, "この子はね、ぷうきちって言うんだ\n武器なんだけど、しゃべるんだよ♪\n大事な大事な、私の友達なんだぁ～！", "アヤネ（クリスマス）", "ヒューマン", 108601, 148, "サレンディア救護院", "芹澤優", 10, 5, "ぷうきちといつも一緒！", 14);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("A", 0, "人助け、応援", 2, 44, "こんにちは！　ヒヨリでっす！\n困っている人がいたら助けにいくよ！\nよかったら一緒に来ない？", "ヒヨリ（ニューイヤー）", "獣人族", 108701, 155, "トゥインクルウィッシュ", "東山奈央", 27, 8, "人助けが大好き！　前向き格闘娘", 16);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("O", 0, "料理、人間観察", 2, 47, "あんまり役に立てるかはわからないけど…\nわたしも頑張って、\nみんなをサポートするね！", "ユイ（ニューイヤー）", "ヒューマン", 108801, 158, "トゥインクルウィッシュ", "種田梨沙", 5, 4, "戦闘のサポートが得意な、心優しい少女", 17);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 0, "読書、乗馬、お茶", 2, 46, "キミと会ったのもきっと何かの縁だ\n一緒に塔の頂上を目指す仲間として\n頑張っていこう。よろしく頼む", "レイ（ニューイヤー）", "魔族", 108901, 163, "トゥインクルウィッシュ", "早見沙織", 12, 1, "クールで何事にも真っ直ぐな剣士", 18);
INSERT INTO `v1_264960e1b4400b2adca862cd836b26fadbcb7a85ba0443f597360884e6e020ba` VALUES ("B", 0, "実験、裁縫、料理", 13, 43, "『壊し屋』の二つ名を持つ私…\nですが、怖がる必要はありませんわ\nあなた様は大切な運命の人ですから…", "エリコ（バレンタイン）", "魔族", 109001, 154, "トワイライトキャラバン", "橋本ちなみ", 30, 7, "運命の相手に一途すぎる乙女", 16);
